(238, 'elementor_remote_info_feed_data', 'a:3:{i:0;a:5:{s:5:\"title\";s:58:\"Monthly Template Kit #2: Build a Beautiful Fitness Website\";s:7:\"excerpt\";s:134:\"It’s time for our second entry in the monthly Template Kit series. Try out the template kit that will motivate you to get jacked!​\";s:7:\"created\";s:10:\"1567496523\";s:5:\"badge\";s:3:\"New\";s:3:\"url\";s:121:\"https://elementor.com/blog/gym-site-template-kit/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:77:\"Elementor Growth Roundup - 15 Experts Share How to Grow Your Business in 2020\";s:7:\"excerpt\";s:166:\"To celebrate Elementor\'s milstone of reaching 3 million websites, we decided to share our growth knowledge and invite top companies and experts to share their own.​\";s:7:\"created\";s:10:\"1566985837\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:114:\"https://elementor.com/blog/growth-roundup/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:71:\"Monday Masterclass: How to Set Up Your Site for Maximum Lead Generation\";s:7:\"excerpt\";s:215:\"This week we’re covering the basic website setup you’ll need to gain maximum conversions. After all, the primary goal for your website, no matter the client or product, is to generate as many leads as possible. \";s:7:\"created\";s:10:\"1566722437\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:132:\"https://elementor.com/blog/optimize-website-lead-generation/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
