ting Parent to Child Theme Customizer Settings\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:66:\"https://siteorigin.com/migrating-parent-child-customizer-settings/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:75:\"https://siteorigin.com/migrating-parent-child-customizer-settings/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 14 Aug 2019 14:47:34 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:8:\"Tutorial\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:8:\"tutorial\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://siteorigin.com/?p=191325\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:728:\"<p>A child theme ensures that your code-level customizations are kept safe and not overwritten during the theme update process. If you think you might need to make code-level customizations in the future, it\'s best to make use of a child theme from the beginning of your WordPress site\'s development. In this tutorial, we\'ll look at what happens to your Customizer settings when switching to a child theme late in the development process and how to quickly resolve the problem.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/migrating-parent-child-customizer-settings/\">Migrating Parent to Child Theme Customizer Settings</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Andrew Misplon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3482:\"<p>A child theme ensures that your code-level customizations are kept safe and not overwritten during the theme update process. If you think you might need to make code-level customizations in the future, it&#8217;s best to make use of a child theme from the beginning of your WordPress site&#8217;s development. In this tutorial, we&#8217;ll look at what happens to your Customizer settings when switching to a child theme late in the development process and how to quickly resolve the problem using <a href=\"https://wordpress.org/plugins/customizer-export-import/\">Customizer Export/Import</a>.</p>\n<h3>Customizer Settings and Your Activated Theme</h3>\n<p>Customizer settings are safely stored in the database with each theme storing its own collection of settings. Just as with any other theme, a child theme has its own collection of settings stored in the database. When switching from your parent theme to a child theme for the first time, your Customizer settings will reset to their default values. This is no problem if you’re installing a child theme at the start of your site’s development. However, if you’ve already set up menus, backgrounds and a long list of theme settings, this is a big time waster.</p>\n<h3>Migrating Customizer Settings from the Parent to a Child Theme</h3>\n<p>Go to <span class=\"adminized-section\"><span class=\"adminized-part\">Plugins</span><span class=\"adminized-arrow icon-arrow-right\"></span><span class=\"adminized-part\">Add New</span></span>, search for and install <span class=\"adminized-section\"><span class=\"adminized-part\">Customizer Export/Import</span></span> plugin. </p>\n<p>With your parent theme activated go to <span class=\"adminized-section\"><span class=\"adminized-part\">Customize</span><span class=\"adminized-arrow icon-arrow-right\"></span><span class=\"adminized-part\">Export/Import</span></span>. Click the Export button which will download a <code>.dat</code> file to your desktop or downloads folder.</p>\n<p>Assuming your child theme has already been installed, go to <span class=\"adminized-section\"><span class=\"adminized-part\">Appearance</span><span class=\"adminized-arrow icon-arrow-right\"></span><span class=\"adminized-part\">Themes</span></span> or <span class=\"adminized-section\"><span class=\"adminized-part\">Appearance</span><span class=\"adminized-arrow icon-arrow-right\"></span><span class=\"adminized-part\">Customize</span></span> and activate it.</p>\n<p>With your child theme activated, go to <span class=\"adminized-section\"><span class=\"adminized-part\">Customize</span><span class=\"adminized-arrow icon-arrow-right\"></span><span class=\"adminized-part\">Export/Import</span></span>, under the Import heading, click the Choose File button, select the <code>.dat</code> file you downloaded in step two, enable the import images option and click Import.</p>\n<h3>Do More with SiteOrigin Premium</h3>\n<p><a href=\"https://siteorigin.com/downloads/premium/\">SiteOrigin Premium</a> offers a huge array of additional functionality for Page Builder by SiteOrigin, the SiteOrigin Widgets Bundle and all of our themes. SiteOrigin Premium also includes access to our next-level email support service, perfect for those times when you need fast and effective technical support.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/migrating-parent-child-customizer-settings/\">Migrating Parent to Child Theme Customizer Settings</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"https://siteorigin.com/migrating-parent-child-customizer-settings/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:61:\"\n		\n		\n				\n				\n		\n				\n\n		\n				\n								\n							\n		\n							\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:46:\"Create WooCommerce Templates with Page Builder\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"https://siteorigin.com/woocommerce-templates-page-builder/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"https://siteorigin.com/woocommerce-templates-page-builder/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 07 Aug 2019 14:25:20 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Announcements\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://siteorigin.com/?p=190344\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:690:\"<p>Take control of your WooCommerce layouts with Page Builder. <a href=\"https://siteorigin.com/downloads/premium/\">SiteOrigin Premium</a> version <code>1.10.0</code> includes our new WooCommerce Templates addon which allows you to build custom Page Builder templates for the Product, Archives, Shop, Cart, Empty Cart, Checkout and My Account pages. Reorganize existing WooCommerce content or add new content, all in the familiar Page Builder interface.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/woocommerce-templates-page-builder/\">Create WooCommerce Templates with Page Builder</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Andrew Misplon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:4485:\"<p>Take control of your WooCommerce layouts with Page Builder by SiteOrigin. <a href=\"https://siteorigin.com/downloads/premium/\">SiteOrigin Premium</a> version <code>1.10.0</code> includes our new WooCommerce Templates addon which allows you to build custom Page Builder templates for the Product, Archives, Shop, Cart, Empty cart, Checkout, and My account pages. Reorganize existing WooCommerce content or add new content, all in the familiar Page Builder interface.</p>\n<p><a href=\"https://siteorigin.com/premium-documentation/plugin-addons/woocommerce-templates/\">View the comprehensive documentation</a>.</p>\n<h3>WooCommerce Template Builder Interface</h3>\n<div id=\"attachment_190486\" style=\"width: 1616px\" class=\"wp-caption alignnone\"><img aria-describedby=\"caption-attachment-190486\" src=\"https://siteorigin.com/wp-content/uploads/2019/08/woocommerce-product-template-default.jpg\" alt=\"WooCommerce Product Template\" width=\"1606\" height=\"1759\" class=\"size-full wp-image-190486\" srcset=\"https://siteorigin.com/wp-content/uploads/2019/08/woocommerce-product-template-default.jpg 1606w, https://siteorigin.com/wp-content/uploads/2019/08/woocommerce-product-template-default-274x300.jpg 274w, https://siteorigin.com/wp-content/uploads/2019/08/woocommerce-product-template-default-768x841.jpg 768w, https://siteorigin.com/wp-content/uploads/2019/08/woocommerce-product-template-default-638x699.jpg 638w, https://siteorigin.com/wp-content/uploads/2019/08/woocommerce-product-template-default-959x1050.jpg 959w, https://siteorigin.com/wp-content/uploads/2019/08/woocommerce-product-template-default-313x343.jpg 313w\" sizes=\"(max-width: 1606px) 100vw, 1606px\" /></p>\n<p id=\"caption-attachment-190486\" class=\"wp-caption-text\">WooCommerce Product Template</p>\n</div>\n<p>The WooCommerce Template Builder interface is separated into seven tabs:</p>\n<ul>\n<li>Product</li>\n<li>Product archive</li>\n<li>Shop</li>\n<li>Cart</li>\n<li>Empty cart</li>\n<li>Checkout</li>\n<li>My account</li>\n</ul>\n<p>The Product and Product archive tabs allow for multiple templates to be created. A default template can be assigned to all product and product archives pages, individual templates can be applied to specific products or product archives as required.</p>\n<h3>WooCommerce Sections in Widget Form</h3>\n<p>Each WooCommerce page section such as the Product short description or Product data tabs have been provided in widget form. </p>\n<div id=\"attachment_190702\" style=\"width: 2204px\" class=\"wp-caption alignnone\"><img aria-describedby=\"caption-attachment-190702\" src=\"https://siteorigin.com/wp-content/uploads/2019/08/product-template-widgets.jpg\" alt=\"WooCommerce product template widgets\" width=\"2194\" height=\"994\" class=\"size-full wp-image-190702\" srcset=\"https://siteorigin.com/wp-content/uploads/2019/08/product-template-widgets.jpg 2194w, https://siteorigin.com/wp-content/uploads/2019/08/product-template-widgets-300x136.jpg 300w, https://siteorigin.com/wp-content/uploads/2019/08/product-template-widgets-768x348.jpg 768w, https://siteorigin.com/wp-content/uploads/2019/08/product-template-widgets-699x317.jpg 699w, https://siteorigin.com/wp-content/uploads/2019/08/product-template-widgets-1050x476.jpg 1050w, https://siteorigin.com/wp-content/uploads/2019/08/product-template-widgets-313x142.jpg 313w\" sizes=\"(max-width: 2194px) 100vw, 2194px\" /></p>\n<p id=\"caption-attachment-190702\" class=\"wp-caption-text\">Product template widgets</p>\n</div>\n<p>You can either start out a template with a prebuilt layout or create your own. In addition to existing WooCommerce functionality in widget form you can also add any of the widgets you&#8217;d normally make use of in Page Builder.</p>\n<h3>Compatible Themes</h3>\n<p>This addon supports themes that offer basic WooCommerce support such as <a href=\"https://wordpress.org/themes/vantage/\" target=\"_blank\" rel=\"noopener noreferrer\">Vantage</a>. Themes that have heavily modified WooCommerce templates such as Corp, unfortunately, aren&#8217;t supported. We hope to release a compatibility setting for Corp soon. If you&#8217;re unsure whether your theme will be compatible, feel free to reach out to us via email on <a href=\"mailto:support@siteorigin.com\">support@siteorigin.com</a>, we&#8217;ll gladly take a look.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/woocommerce-templates-page-builder/\">Create WooCommerce Templates with Page Builder</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:63:\"https://siteorigin.com/woocommerce-templates-page-builder/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:64:\"\n		\n		\n				\n				\n		\n				\n		\n\n		\n				\n								\n							\n		\n							\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:48:\"Unique Page Styling with Custom CSS Body Classes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"https://siteorigin.com/unique-page-styling-custom-css-body-classes/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"https://siteorigin.com/unique-page-styling-custom-css-body-classes/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 04 Aug 2019 14:10:38 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:8:\"Tutorial\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:8:\"tutorial\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://siteorigin.com/?p=188679\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:587:\"<p>The ability to make a rule specific to a post, page or group of posts is really useful and much easier than you might think. WordPress outputs class names into the body tag of each post or page, we can use those class names to prefix our CSS rules and thereby make them specific to the post, page or group of posts we\'d like to target.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/unique-page-styling-custom-css-body-classes/\">Unique Page Styling with Custom CSS Body Classes</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Andrew Misplon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:7787:\"<p>Cascading Style Sheets (CSS) is the programming language used to style your WordPress pages and posts. If you&#8217;d like to make small style changes that aren&#8217;t available via theme or plugin settings, Custom CSS is a great way to do that. Our <a href=\"https://siteorigin.com/css/\">SiteOrigin CSS</a> plugin offers a visual editor interface as well as a standard Custom CSS field for you to enter your CSS rules. If you aren&#8217;t familiar with CSS basics, our <a href=\"https://siteorigin.com/css/visual-editor/\">visual editor</a> is a great way to get started.</p>\n<p>We chat with many users that are comfortable adding Custom CSS rules but aren&#8217;t quite sure how to apply a particular rule to a page or group of pages. The ability to make a rule specific to a post, page or group of posts is really useful and much easier than you might think. WordPress outputs class names into the body tag of each post or page, we can use those class names to prefix our CSS rules and thereby make them specific to the post, page or group of posts we&#8217;d like to target. In this introductory tutorial, we&#8217;ll cover using your browser&#8217;s developer tool to locate body classes and how to apply them to your Custom CSS rules.</p>\n<h3>Opening Your Browser&#8217;s Developer Tool and Locating the Body Tag</h3>\n<p>To get started, browse to the page on your website that you&#8217;d like to customize. Next, open your browser&#8217;s developer tool either by right-clicking anywhere and selecting Inspect (Inspect Element for Firefox and Safari) or via the keyboard shortcut <code>Control + Shift + I</code> on Windows/Linux or <code>Command + Option + I</code> on Mac. In Chrome and Safari, ensure you&#8217;re viewing the Elements tab, in Firefox ensure you&#8217;re viewing the Inspector tab. Next, locate the <code>body</code> tag, you&#8217;ll find it close to the top of the page&#8217;s source code, just below the closing <code>head</code> tag.</p>\n<div id=\"attachment_189826\" style=\"width: 1585px\" class=\"wp-caption alignnone\"><img aria-describedby=\"caption-attachment-189826\" src=\"https://siteorigin.com/wp-content/uploads/2019/08/inspector-body-tag.jpg\" alt=\"Developer inspector view of body tag\" width=\"1575\" height=\"372\" class=\"size-full wp-image-189826\" srcset=\"https://siteorigin.com/wp-content/uploads/2019/08/inspector-body-tag.jpg 1575w, https://siteorigin.com/wp-content/uploads/2019/08/inspector-body-tag-300x71.jpg 300w, https://siteorigin.com/wp-content/uploads/2019/08/inspector-body-tag-768x181.jpg 768w, https://siteorigin.com/wp-content/uploads/2019/08/inspector-body-tag-699x165.jpg 699w, https://siteorigin.com/wp-content/uploads/2019/08/inspector-body-tag-1050x248.jpg 1050w, https://siteorigin.com/wp-content/uploads/2019/08/inspector-body-tag-313x74.jpg 313w\" sizes=\"(max-width: 1575px) 100vw, 1575px\" /></p>\n<p id=\"caption-attachment-189826\" class=\"wp-caption-text\">Locate the body tag, just below the closing head tag.</p>\n</div>\n<p>In this example we&#8217;re viewing the <a href=\"https://demo.siteorigin.com/corp/ target=\"_blank\" rel=\"noopener noreferrer\">Corp demo home page</a>. There are two body classes we could use to target this particular page, either <code>home</code> or <code>page-id-31</code>.</p>\n<h3>Using a Page Body Class to Prefix a CSS Rule</h3>\n<p>Let&#8217;s say for example that we&#8217;d like to change the background color of the Corp demo home page footer. The footer background color is defined by the following CSS rule:</p>\n<pre class=\"prettyprint \">.site-footer {\r\n    background: #363a43;\r\n}</pre>\n<p>If we add the above rule to our Custom CSS and change the background value, the rule will be applied to the entire site. However, if we prefix the rule with one of the body classes specific to the home page, it&#8217;ll ensure the rule is only applied to the home page. The two body classes we can choose from are <code>home</code> or <code>page-id-31</code>, either can be used.</p>\n<pre class=\"prettyprint \">.home .site-footer {\r\n    background: #2f333b;\r\n}</pre>\n<p>The above rule will change the background color of the site footer from <code>#363a43</code> to <code>#2f333b</code> and will do so only on the home page. Note the period before the <code>home</code> class name. Class names are prefixed with a period when writing CSS.</p>\n<h3>Common WordPress Body Class Names</h3>\n<p>Below you&#8217;ll find a list of some of the class names used within WordPress. This list is to give you an idea of some of the common class names used but is by no means complete.</p>\n<p><strong>Home:</strong> <code>home</code><br />\nTargets the static home page assigned at <span class=\"adminized-section\"><span class=\"adminized-part\">Settings</span><span class=\"adminized-arrow icon-arrow-right\"></span><span class=\"adminized-part\">Reading</span></span>.</p>\n<p><strong>Blog:</strong> <code>blog</code><br />\nTargets the blog (posts) page assigned at <span class=\"adminized-section\"><span class=\"adminized-part\">Settings</span><span class=\"adminized-arrow icon-arrow-right\"></span><span class=\"adminized-part\">Reading</span></span>.</p>\n<p><strong>Pages:</strong> <code>page</code> to target all pages or <code>page-id-x</code> to target a single page.<br />\nReplace <code>x</code> with the ID of the page, you can locate the ID by editing the page and checking the URL, the page ID number will be the only number listed in the URL.</p>\n<p><strong>Posts:</strong> <code>single-post</code> to target all posts or <code>postid-x</code> to target a single post.<br />\nReplace <code>x</code> with the ID of the post, you can locate the ID by editing the post and checking the URL, the post ID number will be the only number listed in the URL.</p>\n<p><strong>Archive:</strong> <code>archive</code><br />\nApplies to all archive pages such as category, tag and author archives.</p>\n<p><strong>Category:</strong> <code>category</code> to target all category pages. <code>category-slug</code> or <code>category-x</code> can be used to target a single category. Replace <code>slug</code> with the category slug or <code>x</code> with the ID number of the category you&#8217;re targetting. Either can be used.</p>\n<p><strong>Tag:</strong> <code>tag</code> to target all tag pages. <code>tag-slug</code> or <code>tag-x</code> can be used to target a single tag. Replace <code>slug</code> with the tag slug or <code>x</code> with the ID number of the tag you&#8217;re targetting. Either can be used.</p>\n<p><strong>Author:</strong> <code>author</code> to target all author pages. <code>author-username</code> or <code>author-x</code> can be used to target a single author. Replace <code>username</code> with the author&#8217;s username or <code>x</code> with the ID number of the author you&#8217;re targetting. Either can be used.</p>\n<p><strong>404:</strong> <code>error404</code></p>\n<p><strong>Search Results:</strong> <code>search-results</code></p>\n<h3>Do More with Siteorigin Premium</h3>\n<p><a href=\"http://siteorigin.com/downloads/premium/\">SiteOrigin Premium</a> offers a huge array of additional functionality for Page Builder, the Widgets Bundle and all of our themes. Enhance SiteOrigin CSS with <a href=\"https://siteorigin.com/premium-documentation/plugin-addons/web-font-selector/\">Web Font Selector</a> addon which allows you to easily choose from hundreds of beautiful web fonts right in the visual editor. SiteOrigin Premium also includes access to our next-level email support service, perfect for those times when you need fast and effective technical support.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/unique-page-styling-custom-css-body-classes/\">Unique Page Styling with Custom CSS Body Classes</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"https://siteorigin.com/unique-page-styling-custom-css-body-classes/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"3\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:64:\"\n		\n		\n				\n				\n		\n				\n		\n\n		\n				\n								\n							\n		\n							\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:35:\"Announcing the Mirror Widgets Addon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"https://siteorigin.com/announcing-the-mirror-widgets-addon/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"https://siteorigin.com/announcing-the-mirror-widgets-addon/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 15 May 2019 16:38:04 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:13:\"Announcements\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:7:\"Plugins\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://siteorigin.com/?p=177070\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:599:\"<p>We\'re excited to announce that version <code>1.9</code> of SiteOrigin Premium introduces the Mirror Widgets addon. Create a widget once, use it everywhere. Update it and the changes reflect in all instances of the widget. The Mirror Widget addon is perfect for information or functionality that you’d like to insert in several places but manage in a single location.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/announcing-the-mirror-widgets-addon/\">Announcing the Mirror Widgets Addon</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Andrew Misplon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1252:\"<p>We&#8217;re excited to announce that version <code>1.9</code> of <a href=\"https://siteorigin.com/downloads/premium/\">SiteOrigin Premium</a> introduces the Mirror Widgets addon. Create a widget once, use it everywhere. Update it and the changes reflect in all instances of the widget. The Mirror Widget addon is perfect for information or functionality that you’d like to insert in several pages but manage from a single location. Sliders, banners, contact details and groups of social media icons are just a few of the possible use cases that come to mind. If you&#8217;re currently managing widgets with the same content across multiple pages, we&#8217;re sure you&#8217;ll find this new addon a huge time saver.</p>\n<p><a href=\"https://siteorigin.com/premium-documentation/plugin-addons/mirror-widgets/\">Mirror Widgets documentation</a></p>\n<p>Thanks for reading. If you have any questions or feedback, please let us know in the comments section below. What sort of content might you use the Mirror Widgets addon for?</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/announcing-the-mirror-widgets-addon/\">Announcing the Mirror Widgets Addon</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"https://siteorigin.com/announcing-the-mirror-widgets-addon/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"13\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:61:\"\n		\n		\n				\n				\n		\n				\n\n		\n				\n								\n							\n		\n							\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:52:\"Boost SiteOrigin Plugin Performance with Autoptimize\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"https://siteorigin.com/boost-siteorigin-plugin-performance-autoptimize/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:80:\"https://siteorigin.com/boost-siteorigin-plugin-performance-autoptimize/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 30 Apr 2019 20:35:36 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Announcements\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://siteorigin.com/?p=174492\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:632:\"<p>Autoptimize is our preferred plugin for reducing page size and improving load time, we use it right here on SiteOrigin.com. In our latest release of the Widgets Bundle, version <code>1.15.6</code> we\'ve added a filter which prevents the exclusion of the <code>/uploads/siteorigin-widgets/</code> folder, ensuring Widgets Bundle stylesheets are concatenation and minified.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/boost-siteorigin-plugin-performance-autoptimize/\">Boost SiteOrigin Plugin Performance with Autoptimize</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Andrew Misplon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1306:\"<p><a href=\"https://wordpress.org/plugins/autoptimize/\" target=\"_blank\" rel=\"noopener noreferrer\">Autoptimize</a> is our preferred plugin for reducing page size and improving load time, we use it right here on SiteOrigin.com. By default, Autoptimize excludes the WordPress uploads folder in its concatenation and minification processes. The SiteOrigin Widgets Bundle stores its stylesheets in the uploads folder. This means that up until now, Widgets Bundle generated stylesheets haven&#8217;t been concatenation and minified by Autoptimize. In our latest release of the Widgets Bundle, version <code>1.15.6</code> we&#8217;ve added a filter which prevents the exclusion of the <code>/uploads/siteorigin-widgets/</code> folder, ensuring Widgets Bundle stylesheets are concatenation and minified. If you&#8217;re using Autoptimize, you&#8217;ll already be taking advantage of this enhancement. If not, we recommend you give it a try.</p>\n<p>Thanks for reading. If you have any questions or comments, please let us know in the comments section below.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/boost-siteorigin-plugin-performance-autoptimize/\">Boost SiteOrigin Plugin Performance with Autoptimize</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"https://siteorigin.com/boost-siteorigin-plugin-performance-autoptimize/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"13\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:64:\"\n		\n		\n				\n				\n		\n				\n		\n\n		\n				\n								\n							\n		\n							\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"Announcing the Image Overlay Addon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"https://siteorigin.com/announcing-the-image-overlay-addon/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"https://siteorigin.com/announcing-the-image-overlay-addon/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 18 Apr 2019 13:53:21 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:13:\"Announcements\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:7:\"Plugins\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://siteorigin.com/?p=171037\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:577:\"<p>Add beautiful, customizable hover text overlays with animations to your images. Hover overlays are great for galleries, portfolios or any image that would benefit from displaying information on hover. Overlays can be deployed in seconds using the predefined light/dark themes or fully customized using the wide array of style and animation options.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/announcing-the-image-overlay-addon/\">Announcing the Image Overlay Addon</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Andrew Misplon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:2977:\"<p>Add beautiful, customizable hover text overlays with animations to your images. Great for galleries, portfolios or any image that would benefit from displaying information on hover.</p>\n<p>SiteOrigin Premium version <code>1.8</code> introduces the Image Overlay addon. Once you&#8217;ve updated, head over to <span class=\"adminized-section\"><span class=\"adminized-part\">WP Admin: SiteOrigin Premium</span><span class=\"adminized-arrow icon-arrow-right\"></span><span class=\"adminized-part\">Premium Addons</span><span class=\"adminized-arrow icon-arrow-right\"></span><span class=\"adminized-part\">Image Overlay</span></span> to activate and view the global settings.</p>\n<p><a href=\"https://demo.siteorigin.com/premium/image-overlay/\" target=\"_blank\" rel=\"noopener noreferrer\">View the demo</a>.<br />\n<a href=\"https://siteorigin.com/premium-documentation/plugin-addons/image-overlay/\">View the documentation</a>.</p>\n<p>Support has been provided for the SiteOrigin Image, Image Grid, and Simple Masonry widgets. Overlays can be deployed in seconds using the predefined light/dark themes or fully customized using the wide array of style and animation options provided in the global addon settings. Overlay text is provided by the Media Library image title or the widget image title.</p>\n<div id=\"attachment_172355\" style=\"width: 2290px\" class=\"wp-caption alignnone\"><img aria-describedby=\"caption-attachment-172355\" src=\"https://siteorigin.com/wp-content/uploads/2019/04/overlay-dark-masonry.jpg\" alt=\"\" width=\"2280\" height=\"1140\" class=\"size-full wp-image-172355\" srcset=\"https://siteorigin.com/wp-content/uploads/2019/04/overlay-dark-masonry.jpg 2280w, https://siteorigin.com/wp-content/uploads/2019/04/overlay-dark-masonry-300x150.jpg 300w, https://siteorigin.com/wp-content/uploads/2019/04/overlay-dark-masonry-768x384.jpg 768w, https://siteorigin.com/wp-content/uploads/2019/04/overlay-dark-masonry-699x350.jpg 699w, https://siteorigin.com/wp-content/uploads/2019/04/overlay-dark-masonry-1050x525.jpg 1050w, https://siteorigin.com/wp-content/uploads/2019/04/overlay-dark-masonry-313x157.jpg 313w\" sizes=\"(max-width: 2280px) 100vw, 2280px\" /></p>\n<p id=\"caption-attachment-172355\" class=\"wp-caption-text\">An example of the dark overlay theme used in the Simple Masonry widget.</p>\n</div>\n<h3>Do More with SiteOrigin Premium</h3>\n<p><a href=\"https://siteorigin.com/downloads/premium/\">SiteOrigin Premium</a> offers a huge array of additional functionality for Page Builder, the Widgets Bundle and all of our themes. Enhance your layouts with the Image Overlay and 17 other powerful addons.</p>\n<p>If you&#8217;ve built something awesome with the Image Overlay addon and would like to share it, feel free to let us know in the comments section below.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/announcing-the-image-overlay-addon/\">Announcing the Image Overlay Addon</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:63:\"https://siteorigin.com/announcing-the-image-overlay-addon/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"6\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:64:\"\n		\n		\n				\n				\n		\n				\n		\n\n		\n				\n								\n							\n		\n							\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:42:\"Build Your Portfolio with Corp and Jetpack\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"https://siteorigin.com/build-your-portfolio-corp-jetpack/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:66:\"https://siteorigin.com/build-your-portfolio-corp-jetpack/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 15 Apr 2019 10:09:38 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:13:\"Announcements\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:6:\"Themes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://siteorigin.com/?p=169774\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:508:\"<p>We\'re excited to announce Jetpack Portfolio support for our Corp theme. Jetpack Portfolio is a custom post type that allows you to easily add and manage your portfolio projects. A portfolio can be any body of work that you\'d like to show off to your prospective customers.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/build-your-portfolio-corp-jetpack/\">Build Your Portfolio with Corp and Jetpack</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Andrew Misplon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3324:\"<p>We&#8217;re excited to announce Jetpack Portfolio support for our Corp theme. Jetpack Portfolio is a custom post type that allows you to easily add and manage your portfolio projects. A portfolio can be any body of work that you&#8217;d like to show off to your prospective customers.</p>\n<p><a href=\"https://demo.siteorigin.com/corp/portfolio/\" target=\"_blank\" rel=\"noopener noreferrer\">View the demo</a>.<br />\n<a href=\"https://siteorigin.com/corp-documentation/portfolio/\">View the documentation</a>.</p>\n<h4>Filter and Sort</h4>\n<p>Corp&#8217;s portfolio layout sorts your projects by type, allowing users to quickly filter the projects they&#8217;d like to view. Projects snap into place using the stunning Isotope masonry effect.</p>\n<div id=\"attachment_171625\" style=\"width: 396px\" class=\"wp-caption alignnone\"><img aria-describedby=\"caption-attachment-171625\" src=\"https://siteorigin.com/wp-content/uploads/2019/04/portfolio-filter.png\" alt=\"\" width=\"386\" height=\"82\" class=\"size-full wp-image-171625\" srcset=\"https://siteorigin.com/wp-content/uploads/2019/04/portfolio-filter.png 386w, https://siteorigin.com/wp-content/uploads/2019/04/portfolio-filter-300x64.png 300w, https://siteorigin.com/wp-content/uploads/2019/04/portfolio-filter-313x66.png 313w\" sizes=\"(max-width: 386px) 100vw, 386px\" /></p>\n<p id=\"caption-attachment-171625\" class=\"wp-caption-text\">Filter and sort by project type.</p>\n</div>\n<h4>Project Details on Hover</h4>\n<p>Each project&#8217;s name and type is displayed when hovering over the project thumbnail.</p>\n<div id=\"attachment_171626\" style=\"width: 310px\" class=\"wp-caption alignnone\"><img aria-describedby=\"caption-attachment-171626\" src=\"https://siteorigin.com/wp-content/uploads/2019/04/project-hover-300x300.jpg\" alt=\"\" width=\"300\" height=\"300\" class=\"size-medium wp-image-171626\" srcset=\"https://siteorigin.com/wp-content/uploads/2019/04/project-hover-300x300.jpg 300w, https://siteorigin.com/wp-content/uploads/2019/04/project-hover-150x150.jpg 150w, https://siteorigin.com/wp-content/uploads/2019/04/project-hover-699x699.jpg 699w, https://siteorigin.com/wp-content/uploads/2019/04/project-hover-313x313.jpg 313w, https://siteorigin.com/wp-content/uploads/2019/04/project-hover-128x128.jpg 128w, https://siteorigin.com/wp-content/uploads/2019/04/project-hover-256x256.jpg 256w, https://siteorigin.com/wp-content/uploads/2019/04/project-hover.jpg 724w\" sizes=\"(max-width: 300px) 100vw, 300px\" /></p>\n<p id=\"caption-attachment-171626\" class=\"wp-caption-text\">Project name and type visible on hover.</p>\n</div>\n<h4>Flexbile Display Options</h4>\n<p>Your portfolio can be inserted using the default URL structure, a SiteOrigin Post Loop widget or using the Jetpack shortcode, the choice is yours.</p>\n<h3>Do More with SiteOrigin Premium</h3>\n<p><a href=\"http://siteorigin.com/downloads/premium/\">SiteOrigin Premium</a> offers a huge array of additional functionality for Page Builder, the Widgets Bundle and all of our themes. Remove the Corp footer attribution, add Ajax comments and enhance your Corp Page Builder layouts with the Animations Addon.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/build-your-portfolio-corp-jetpack/\">Build Your Portfolio with Corp and Jetpack</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"https://siteorigin.com/build-your-portfolio-corp-jetpack/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:61:\"\n		\n		\n				\n				\n		\n				\n\n		\n				\n								\n							\n		\n							\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:42:\"10 Beautiful Google Font Pairings for 2019\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"https://siteorigin.com/10-beautiful-google-font-pairings-2019/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"https://siteorigin.com/10-beautiful-google-font-pairings-2019/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 28 Mar 2019 10:10:51 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"Tutorial\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://siteorigin.com/?p=167232\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:587:\"<p>Choosing complimentary Google Fonts that match your website design and branding can be daunting. To celebrate the launch of our <a href=\"https://siteorigin.com/google-fonts-now-in-the-editor-widget/\">expanded Web Font Selector addon</a>, we\'ve selected 10 beautiful combinations for 2019, ready for your blog, portfolio or business focussed site.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/10-beautiful-google-font-pairings-2019/\">10 Beautiful Google Font Pairings for 2019</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Andrew Misplon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:12425:\"<p>Choosing complimentary Google Fonts that match your website design and branding can be daunting. To celebrate the launch of our <a href=\"https://siteorigin.com/google-fonts-now-in-the-editor-widget/\">expanded Web Font Selector addon</a>, we&#8217;ve selected 10 beautiful combinations for 2019, ready for your blog, portfolio or business focussed site.</p>\n<h2>Sans Serif and Sans Serif</h2>\n<div style=\"background:#efefef; margin-bottom: 35px; padding:35px;\">\n<style>\n	@import url(\'https://fonts.googleapis.com/css?family=Oxygen:300|Source+Sans+Pro\');\n	</style>\n<h3 style=\"color: #2d2d2d; font-family: \'Oxygen\', sans-serif; font-size: 26px; font-weight: 300; margin: 0;\">Oxygen Light and Source Sans Pro Regular</h3>\n<p style=\"color: #626262; font-family: \'Source Sans Pro\', sans-serif; font-size: 16px; line-height: 29px;\">In the wake of the French Revolution and the Napoleonic Wars, Iceland&#8217;s struggle for independence took form and culminated in independence in 1918 and the founding of a republic in 1944. Until the 20th century, Iceland relied largely on subsistence fishing and agriculture, and was among the poorest countries in Europe. Industrialisation of the fisheries and Marshall Plan aid following World War II brought prosperity and Iceland became one of the wealthiest and most developed nations in the world. In 1994, it became a part of the European Economic Area, which further diversified the economy into sectors such as finance, biotechnology, and manufacturing.</p>\n</div>\n<div style=\"background:#efefef; margin-bottom: 35px; padding:35px;\">\n<style>\n	@import url(\'https://fonts.googleapis.com/css?family=Open+Sans|Raleway:300\');\n	</style>\n<h3 style=\"color: #2d2d2d; font-family: \'Raleway\', sans-serif; font-size: 26px; font-weight: 300; margin: 0;\">Raleway Light and Open Sans Regular</h3>\n<p style=\"color: #626262; font-family: \'Open Sans\', sans-serif; font-size: 16px; line-height: 29px;\">Iceland has a market economy with relatively low taxes, compared to other OECD countries. It maintains a Nordic social welfare system that provides universal health care and tertiary education for its citizens. Iceland ranks high in economic, democratic, social stability, and equality, currently ranking first in the world by median wealth per adult. In 2018, it was ranked as the sixth most developed country in the world by the United Nations&#8217; Human Development Index, and it ranks first on the Global Peace Index. Iceland runs almost completely on renewable energy.</p>\n</div>\n<div style=\"background:#efefef; margin-bottom: 35px; padding:35px;\">\n<style>\n	@import url(\'https://fonts.googleapis.com/css?family=Roboto|Roboto+Condensed:700\');\n	</style>\n<h3 style=\"color: #2d2d2d; font-family: \'Roboto Condensed\', sans-serif; font-size: 26px; font-weight: 700; margin: 0;\">Roboto Condensed Bold and Roboto Regular</h3>\n<p style=\"color: #626262; font-family: \'Roboto\', sans-serif; font-size: 16px; line-height: 29px;\">The Sagas of Icelanders say that a Norwegian named Naddodd (or Naddador) was the first Norseman to reach Iceland, and in the 9th century he named it Snæland or &#8220;snow land&#8221; because it was snowing. Following Naddodd, the Swede Garðar Svavarsson arrived, and so the island was then called Garðarshólmur which means &#8220;Garðar&#8217;s Isle&#8221;.</p>\n</div>\n<div style=\"background:#efefef; margin-bottom: 35px; padding:35px;\">\n<style>\n	@import url(\'https://fonts.googleapis.com/css?family=Lato|Ubuntu:700\');\n	</style>\n<h3 style=\"color: #2d2d2d; font-family: \'Ubuntu\', sans-serif; font-weight: 700; font-size: 26px; margin: 0;\">Ubuntu Bold and Lato Regular</h3>\n<p style=\"color: #626262; font-family: \'Lato\', sans-serif; font-size: 16px; line-height: 29px;\">According to the ancient manuscript Landnámabók, the settlement of Iceland began in 874 AD when the Norwegian chieftain Ingólfr Arnarson became the first permanent settler on the island. In the following centuries, Norwegians, and to a lesser extent other Scandinavians, emigrated to Iceland, bringing with them thralls (i.e., slaves or serfs) of Gaelic origin. The island was governed as an independent commonwealth under the Althing, one of the world&#8217;s oldest functioning legislative assemblies.</p>\n</div>\n<h2>Serif and Sans Serif</h2>\n<div style=\"background:#efefef; margin-bottom: 35px; padding:35px;\">\n<style>\n	@import url(\'https://fonts.googleapis.com/css?family=Cardo|Libre+Franklin\');\n	</style>\n<h3 style=\"color: #2d2d2d; font-family: \'Cardo\', serif; font-size: 26px; margin: 0;\">Cardo Regular and Libre Franklin Regular</h3>\n<p style=\"color: #626262; font-family: \'Libre Franklin\', sans-serif; font-size: 16px; line-height: 29px;\">Icelandic culture is founded upon the nation&#8217;s Scandinavian heritage. Most Icelanders are descendants of Norse and Gaelic settlers. Icelandic, a North Germanic language, is descended from Old West Norse and is closely related to Faroese and West Norwegian dialects. The country&#8217;s cultural heritage includes traditional Icelandic cuisine, Icelandic literature, and medieval sagas. Iceland has the smallest population of any NATO member and is the only one with no standing army, with a lightly armed coast guard.</p>\n</div>\n<div style=\"background:#efefef; margin-bottom: 35px; padding:35px;\">\n<style>\n	@import url(\'https://fonts.googleapis.com/css?family=Merriweather|Muli:300\');\n	</style>\n<h3 style=\"color: #2d2d2d; font-family: \'Merriweather\', serif; font-size: 26px; margin: 0;\">Merriweather Regular and Muli Light</h3>\n<p style=\"color: #626262; font-family: \'Muli\', sans-serif; font-size: 16px; font-weight: 300; line-height: 29px;\">The interior consists of a plateau characterised by sand and lava fields, mountains, and glaciers, and many glacial rivers flow to the sea through the lowlands. Iceland is warmed by the Gulf Stream and has a temperate climate, despite a high latitude just outside the Arctic Circle. Its high latitude and marine influence keep summers chilly, with most of the archipelago having a tundra climate.</p>\n</div>\n<div style=\"background:#efefef; margin-bottom: 35px; padding:35px;\">\n<style>\n	@import url(\'https://fonts.googleapis.com/css?family=Exo|Vollkorn:700\');\n	</style>\n<h3 style=\"color: #2d2d2d; font-family: \'Vollkorn\', serif; font-size: 26px; font-weight: 700; margin: 0;\">Vollkorn Bold and Exo Regular</h3>\n<p style=\"color: #626262; font-family: \'Exo\', sans-serif; font-size: 16px; line-height: 29px;\">Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nullam condimentum eleifend fringilla. Nam pharetra tortor in urna convallis viverra. Nulla hendrerit ipsum id iaculis imperdiet. In massa risus, consectetur nec luctus id, iaculis et metus. Phasellus lacus metus, pharetra quis eleifend et, hendrerit vitae augue. Curabitur fringilla libero ac augue tristique, auctor posuere nibh vulputate. Fusce eu tellus ut ligula tempus sollicitudin vitae sit amet velit.</p>\n</div>\n<h2>Sans Serif and Serif</h2>\n<div style=\"background:#efefef; margin-bottom: 35px; padding:35px;\">\n<style>\n	@import url(\'https://fonts.googleapis.com/css?family=Roboto+Slab:300|Ruda\');\n	</style>\n<h3 style=\"color: #2d2d2d; font-family: \'Ruda\', sans-serif; font-size: 26px; margin: 0;\">Ruda Regular and Roboto Slab Light</h3>\n<p style=\"color: #626262; font-family: \'Roboto Slab\', serif; font-size: 16px; font-weight: 300; line-height: 29px;\">Iceland is a Nordic island country in the North Atlantic, with a population of 348,580 and an area of 103,000 km2 (40,000 sq mi), making it the most sparsely populated country in Europe. The capital and largest city is Reykjavík, with Reykjavík and the surrounding areas in the southwest of the country being home to over two-thirds of the population. Iceland is volcanically and geologically active.</p>\n</div>\n<div style=\"background:#efefef; margin-bottom: 35px; padding:35px;\">\n<style>\n	@import url(\'https://fonts.googleapis.com/css?family=Oswald|Quattrocento\');\n	</style>\n<h3 style=\"color: #2d2d2d; font-family: \'Oswald\', sans-serif; font-size: 26px; margin: 0;\">Oswald Regular and Quattrocento Regular</h3>\n<p style=\"color: #626262; font-family: \'Quattrocento\', serif; font-size: 16px; line-height: 29px;\">Following a period of civil strife, Iceland acceded to Norwegian rule in the 13th century. The establishment of the Kalmar Union in 1397 united the kingdoms of Norway, Denmark, and Sweden. Iceland thus followed Norway&#8217;s integration into that union, coming under Danish rule after Sweden&#8217;s secession from the union in 1523. Although the Danish kingdom introduced Lutheranism forcefully in 1550, Iceland remained a distant semi-colonial territory in which Danish institutions and infrastructures were conspicuous by their absence.</p>\n</div>\n<div style=\"background:#efefef; margin-bottom: 35px; padding:35px;\">\n<style>\n	@import url(\'https://fonts.googleapis.com/css?family=PT+Sans:700|Playfair+Display\');\n	</style>\n<h3 style=\"color: #2d2d2d; font-family: \'PT Sans\', sans-serif; font-size: 26px; font-weight: 700; margin: 0;\">PT Sans Bold and Playfair Display Regular</h3>\n<p style=\"color: #626262; font-family: \'Playfair Display\', serif; font-size: 16px; line-height: 29px;\">Hit hard by the worldwide financial crisis, the nation&#8217;s entire banking system systemically failed in October 2008, leading to a severe depression, substantial political unrest, the Icesave dispute, and the institution of capital controls. Some bankers were jailed. Since then, the economy has made a significant recovery, in large part due to a surge in tourism. A law that took effect in 2018 makes it illegal in Iceland for women to be paid less than men.</p>\n</div>\n<div style=\"background:#efefef; margin-bottom: 35px; padding:35px;\">\n<style>\n	@import url(\'https://fonts.googleapis.com/css?family=Lora|Montserrat:700\');\n	</style>\n<h3 style=\"color: #2d2d2d; font-family: \'Montserrat\', sans-serif; font-size: 26px; font-weight: 700; margin: 0;\">Montserrat Bold and Lora Regular</h3>\n<p style=\"color: #626262; font-family: \'Lora\', serif; font-size: 16px; line-height: 29px;\">Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nullam condimentum eleifend fringilla. Nam pharetra tortor in urna convallis viverra. Nulla hendrerit ipsum id iaculis imperdiet. In massa risus, consectetur nec luctus id, iaculis et metus. Phasellus lacus metus, pharetra quis eleifend et, hendrerit vitae augue. Curabitur fringilla libero ac augue tristique, auctor posuere nibh vulputate. Fusce eu tellus ut ligula tempus sollicitudin vitae sit amet velit.</p>\n</div>\n<h2>SiteOrigin Editor Google Font Selector</h2>\n<p><a href=\"https://siteorigin.com/downloads/premium/\">SiteOrigin Premium</a> version <code>1.7</code> includes an exciting expansion to the Web Font Selector addon. It&#8217;s now possible to choose from over 900 beautiful Google Web Fonts, right inside the SiteOrigin Editor widget or any instance of the TinyMCE editor. For content you haven&#8217;t yet written, the font family can be selected before typing. Alternatively, for existing content, simply highlight the text and then select the font of your choice. If you&#8217;d like to select fonts independently from theme settings, the Web Font Selector is a perfect addition to your content creation and editing process. </p>\n<p><a href=\"https://siteorigin.com/premium-documentation/plugin-addons/web-font-selector/\">SiteOrigin Premium Web Font Selector documentation</a>.</p>\n<h3>Further Reading</h3>\n<p><a href=\"https://design.google/library/choosing-web-fonts-beginners-guide/\" rel=\"noopener noreferrer\" target=\"_blank\">Choosing Web Fonts: A Beginner’s Guide</a><br />\n<a href=\"https://www.canva.com/learn/serif-vs-sans-serif-fonts/\" rel=\"noopener noreferrer\" target=\"_blank\">Serif vs Sans Serif Fonts</a><br />\n<a href=\"https://fonts.google.com/analytics\">Google Fonts Analytics</a> </p>\n<p>Thanks for reading, hopefully, you&#8217;ve found a font combination for your next project. If not, there are many more options to choose from. Perhaps try <a href=\"https://fontpair.co/\" rel=\"noopener noreferrer\" target=\"_blank\">FontPair</a> for a helping hand. </p>\n<p>Are there any Google Font combinations you enjoy using for your projects? Let us know in the comments section below.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/10-beautiful-google-font-pairings-2019/\">10 Beautiful Google Font Pairings for 2019</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"https://siteorigin.com/10-beautiful-google-font-pairings-2019/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"7\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:61:\"\n		\n		\n				\n				\n		\n				\n\n		\n				\n								\n							\n		\n							\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:37:\"Google Fonts Now in the Editor Widget\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:61:\"https://siteorigin.com/google-fonts-now-in-the-editor-widget/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:70:\"https://siteorigin.com/google-fonts-now-in-the-editor-widget/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 22 Mar 2019 13:00:07 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Announcements\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://siteorigin.com/?p=166033\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:548:\"<p><a href=\"https://siteorigin.com/downloads/premium/\">SiteOrigin Premium</a> version <code>1.7</code> includes an exciting expansion to the Web Font Selector addon. It\'s now possible to choose from over 900 beautiful Google Web Fonts, right inside the SiteOrigin Editor widget or any instance of the TinyMCE editor.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/google-fonts-now-in-the-editor-widget/\">Google Fonts Now in the Editor Widget</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Andrew Misplon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3861:\"<p><a href=\"https://siteorigin.com/downloads/premium/\">SiteOrigin Premium</a> version <code>1.7</code> includes an exciting expansion to the Web Font Selector addon. It&#8217;s now possible to choose from over 900 beautiful Google Web Fonts, right inside the SiteOrigin Editor widget or any instance of the TinyMCE editor. For content you haven&#8217;t yet written, the font family can be selected before typing. Alternatively, for existing content, simply highlight the text and then select the font of your choice.</p>\n<div id=\"attachment_166761\" style=\"width: 709px\" class=\"wp-caption alignnone\"><img aria-describedby=\"caption-attachment-166761\" class=\"size-large wp-image-166761\" src=\"https://siteorigin.com/wp-content/uploads/2019/03/siteorigin-editor-web-font-selector-699x403.png\" alt=\"\" width=\"699\" height=\"403\" srcset=\"https://siteorigin.com/wp-content/uploads/2019/03/siteorigin-editor-web-font-selector-699x403.png 699w, https://siteorigin.com/wp-content/uploads/2019/03/siteorigin-editor-web-font-selector-300x173.png 300w, https://siteorigin.com/wp-content/uploads/2019/03/siteorigin-editor-web-font-selector-768x442.png 768w, https://siteorigin.com/wp-content/uploads/2019/03/siteorigin-editor-web-font-selector-1050x605.png 1050w, https://siteorigin.com/wp-content/uploads/2019/03/siteorigin-editor-web-font-selector-313x180.png 313w\" sizes=\"(max-width: 699px) 100vw, 699px\" /></p>\n<p id=\"caption-attachment-166761\" class=\"wp-caption-text\">The Select Web Font drop-down offers a wide range of Google hosted fonts.</p>\n</div>\n<p>The SiteOrigin Premium Web Font Selector is added to any instance of the TinyMCE editor. Below is a small sample of the plugins, widgets, and locations you&#8217;ll find the TinyMCE editor:</p>\n<ul>\n<li><a href=\"https://wordpress.org/plugins/so-widgets-bundle/\" target=\"_blank\" rel=\"noopener noreferrer\">SiteOrigin Widgets Bundle:</a>\n<ul>\n<li>SiteOrigin Editor widget</li>\n<li>SiteOrigin Accordion widget</li>\n<li>SiteOrigin Contact Form widget</li>\n<li>SiteOrigin Features widget</li>\n<li>SiteOrigin Google Maps widget</li>\n<li>SiteOrigin Hero widget</li>\n<li>SiteOrigin Tabs widget</li>\n<li>SiteOrigin Testimonial widget</li>\n</ul>\n</li>\n<li>Other Plugins:\n<ul>\n<li><a href=\"https://wordpress.org/plugins/so-css/\" target=\"_blank\" rel=\"noopener noreferrer\">SiteOrigin CSS Editor</a></li>\n<li><a href=\"https://wordpress.org/plugins/black-studio-tinymce-widget/\" target=\"_blank\" rel=\"noopener noreferrer\">Black Studio TinyMCE Widget</a></li>\n</ul>\n</li>\n<li>WordPress Core:\n<ul>\n<li>The default Classic Editor Visual tab</li>\n<li>The Block Editor (Gutenberg) Classic block</li>\n</ul>\n</li>\n</ul>\n<p>The SiteOrigin Widgets Bundle plugin isn&#8217;t required to add the Web Font Selector to other plugins or the WordPress core (Classic Editor or Block Editor). If you&#8217;d like to select fonts independently from theme settings, the Web Font Selector is a perfect addition to your content creation and editing process.</p>\n<p><a href=\"https://siteorigin.com/premium-documentation/plugin-addons/web-font-selector/\">View the addon documentation</a>.</p>\n<h3>Additional Features and a Helping Hand with SiteOrigin Premium</h3>\n<p>SiteOrigin Premium is a single plugin that adds loads of additional settings and functionality to SiteOrigin widgets, Page Builder and SiteOrign themes. The Web Font Selector is just one of 17 addons included. <a href=\"https://siteorigin.com/downloads/premium/\">Find out more</a> about our premium plugin and next level email support service.</p>\n<p>Thanks for reading. If you have any questions or feedback, please let us know in the comments section below.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/google-fonts-now-in-the-editor-widget/\">Google Fonts Now in the Editor Widget</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:66:\"https://siteorigin.com/google-fonts-now-in-the-editor-widget/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"3\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:61:\"\n		\n		\n				\n				\n		\n				\n\n		\n				\n								\n							\n		\n							\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Announcing the Map Styles Addon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"https://siteorigin.com/announcing-the-map-styles-addon/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"https://siteorigin.com/announcing-the-map-styles-addon/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 12 Mar 2019 09:19:10 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Announcements\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://siteorigin.com/?p=164406\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:620:\"<p>We\'re excited to announce the Map Styles addon for <a href=\"https://siteorigin.com/downloads/premium/\">SiteOrigin Premium</a>. Map Styles adds over twenty hand-picked map styles to the <a href=\"https://siteorigin.com/widgets-bundle/google-maps-widget/\">SiteOrigin Google Maps widget</a>. With a single click, select the map style that best suits your page, site design or specific map application.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/announcing-the-map-styles-addon/\">Announcing the Map Styles Addon</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Andrew Misplon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:2591:\"<p>We&#8217;re excited to announce the Map Styles addon for <a href=\"https://siteorigin.com/downloads/premium/\">SiteOrigin Premium</a>. Map Styles adds over twenty hand-picked map styles to the <a href=\"https://siteorigin.com/widgets-bundle/google-maps-widget/\">SiteOrigin Google Maps widget</a>. With a single click, select the map style that best suits your page, site design or specific map application.</p>\n<p>Our SiteOrigin Google Maps widget is a fully fledged Google Maps builder with options available for markers, routes, and styles. Maps are a great way to offer directions to an event, visualize a road trip, display your branch locations or let users know how to get to your store. Predefined map styles let you customize your map look and feel without the need to create a design yourself. View the currently available styles in the <a href=\"https://demo.siteorigin.com/premium/map-styles-addon/\" target=\"_blank\" rel=\"noopener noreferrer\">demo</a>.</p>\n<p><img class=\"alignnone size-full wp-image-164529\" src=\"https://siteorigin.com/wp-content/uploads/2019/03/premium-map-styles-choices.jpg\" alt=\"\" width=\"2630\" height=\"1370\" srcset=\"https://siteorigin.com/wp-content/uploads/2019/03/premium-map-styles-choices.jpg 2630w, https://siteorigin.com/wp-content/uploads/2019/03/premium-map-styles-choices-300x156.jpg 300w, https://siteorigin.com/wp-content/uploads/2019/03/premium-map-styles-choices-768x400.jpg 768w, https://siteorigin.com/wp-content/uploads/2019/03/premium-map-styles-choices-699x364.jpg 699w, https://siteorigin.com/wp-content/uploads/2019/03/premium-map-styles-choices-1050x547.jpg 1050w, https://siteorigin.com/wp-content/uploads/2019/03/premium-map-styles-choices-313x163.jpg 313w\" sizes=\"(max-width: 2630px) 100vw, 2630px\" /></p>\n<p>If you&#8217;re already using SiteOrigin Premium and have updated to version <code>1.6</code>, you can go to <span class=\"adminized-section\"><span class=\"adminized-part\">SiteOrigin</span><span class=\"adminized-arrow icon-arrow-right\"></span><span class=\"adminized-part\">Premium Addons</span></span> to activate the Map Styles addon. Find out more about how to use the Map Styles addon in the <a href=\"https://siteorigin.com/premium-documentation/plugin-addons/map-styles/\">documentation</a>.</p>\n<p>Thanks for reading. If you have any questions or feedback, please let us know in the comments section below.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/announcing-the-map-styles-addon/\">Announcing the Map Styles Addon</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:60:\"https://siteorigin.com/announcing-the-map-styles-addon/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"3\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}s:27:\"http://www.w3.org/2005/Atom\";a:1:{s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:4:\"href\";s:28:\"https://siteorigin.com/feed/\";s:3:\"rel\";s:4:\"self\";s:4:\"type\";s:19:\"application/rss+xml\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:44:\"http://purl.org/rss/1.0/modules/syndication/\";a:2:{s:12:\"updatePeriod\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"\n	hourly	\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:15:\"updateFrequency\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"\n	1	\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}}}}s:4:\"type\";i:128;s:7:\"headers\";O:42:\"Requests_Utility_CaseInsensitiveDictionary\":1:{s:7:\"\0*\0data\";a:19:{s:4:\"date\";s:29:\"Tue, 10 Sep 2019 01:45:06 GMT\";s:12:\"content-type\";s:34:\"application/rss+xml; charset=UTF-8\";s:14:\"content-length\";s: